/* ============================================================
 * Lookup Function
 * ============================================================ */
const EmbeddedAsset* embedded_asset_find(const char* name)
{
    int i;
    
    if (!name) return NULL;
    
    for (i = 0; i < g_embedded_assets_count; i++) {
        if (g_embedded_assets[i].name && 
            strcmp(g_embedded_assets[i].name, name) == 0) {
            return &g_embedded_assets[i];
        }
    }
    
    return NULL;
}
